INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(3, '<article class="content__article"><p class="content__article_p">Hello! My name is <span>Sergey Buharow</span>.</p><p class="content__article_p">I have experience building dynamic and responsive websites using HTML, PHP, MySQL, CSS, jQuery, and AJAX</p><p class="content__article_p">My areas of expertise are in building web apps using PHP, MySQL, Laravel 4-5, Drupal and Bootstrap.</p></article>', 'About', 'full_html'),
(4, '<div class="skills"><div class="skills__group"><span class="skills__group_title">Skills:</span><span class="skills__group_tag"><strong>PHP</strong></span><span class="skills__group_tag">OOP-development</span><span class="skills__group_tag">HTML5, CSS 3</span><span class="skills__group_tag">Javascript</span></div><div class="skills__group"><div class="skills__group_title">Prefer:</div><span class="skills__group_tag"><a href="https://en.wikipedia.org/wiki/Don%27t_repeat_yourself" target="_blank" class="skills__group_a">DRY development</a><i class="fa fa-external-link"></i></span><span class="skills__group_tag"><a href="https://en.wikipedia.org/wiki/KISS_principle" target="_blank" class="skills__group_a">KISS principle</a><i class="fa fa-external-link"></i></span><span class="skills__group_tag"><a href="http://www.php-fig.org/psr/" target="_blank" class="skills__group_a">PSR</a><i class="fa fa-external-link"></i></span></div><div class="skills__group"><span class="skills__group_title">Frameworks:</span><span class="skills__group_tag"><strong>Laravel 5</strong></span><span class="skills__group_tag">Slim Framework</span><span class="skills__group_tag">Drupal</span></div><div class="skills__group"><span class="skills__group_title">Front-end:</span><span class="skills__group_tag">Less</span><span class="skills__group_tag">Sass</span><span class="skills__group_tag">Bootstrap</span><span class="skills__group_tag">jQuery</span></div><div class="skills__group"><span class="skills__group_title">Databases:</span><span class="skills__group_tag">MySQL 5.5+</span><span class="skills__group_tag">SQLite</span><span class="skills__group_tag">MongoDB</span></div><div class="skills__group"><span class="skills__group_title">Instruments:</span><span class="skills__group_tag">Photoshop</span><span class="skills__group_tag">Git</span><span class="skills__group_tag">Grunt/Gulp</span><span class="skills__group_tag">Ubuntu</span></div><div class="skills__group"><span class="skills__group_title">Services:</span><span class="skills__group_tag">GitHub</span><span class="skills__group_tag">BitBucket</span><span class="skills__group_tag">Jira</span></div></div>', 'Skills', 'full_html'),
(5, '<div class="page__wrapper_center"><footer class="footer"><a href="mailto:s.buharow@gmail.com" class="footer_a"><span class="footer_span">s.buharow@gmail.com</span></a></footer></div>', 'Footer', 'full_html'),
(6, '<div class="row"><a href="/projects/this-one" class="project__a col-xs-12 col-sm-4">\r\n    <div class="row">\r\n      <div class="project__img-gutter">\r\n        <div class="zoom"><i class="fa fa-folder-open"></i></div><img src="/images/2016-04-18_8-56-45.jpg" alt="This One" class="project__img">\r\n      </div>\r\n      <div class="project__title">This One</div>\r\n    </div></a><a href="/projects/scanlibs-idea" class="project__a col-xs-12 col-sm-4">\r\n    <div class="row">\r\n      <div class="project__img-gutter">\r\n        <div class="zoom"><i class="fa fa-folder-open"></i></div><img src="/images/56f7c1bf5b3cb.jpg" alt="Scanlibs Idea" class="project__img">\r\n      </div>\r\n      <div class="project__title">Scanlibs Idea</div>\r\n    </div></a><a href="/projects/slim-scalling" class="project__a col-xs-12 col-sm-4 col_ima">\r\n    <div class="row">\r\n      <div class="project__img-gutter">\r\n        <div class="zoom"><i class="fa fa-folder-open"></i></div><img src="/images/56f80518a7cd3.jpg" alt="Slim Scalling" class="project__img">\r\n      </div>\r\n      <div class="project__title">Slim Scalling</div>\r\n    </div></a><a href="/projects/contats-us" class="project_a col-xs-12 col-sm-4">\r\n    <div class="row">\r\n      <div class="project__img-gutter">\r\n        <div class="zoom"><i class="fa fa-folder-open"></i></div><img src="/images/56f9163df3fc3.jpg" alt="Contact Us" class="project__img">\r\n      </div>\r\n      <div class="project__title">Contact Us</div>\r\n    </div></a><a href="/projects/roundfollio" class="project__a col-xs-12 col-sm-4">\r\n    <div class="row">\r\n      <div class="project__img-gutter">\r\n        <div class="zoom"><i class="fa fa-folder-open"></i></div><img src="/images/56f90dd5e7e03.jpg" alt="Rounfollio" class="project__img">\r\n      </div>\r\n      <div class="project__title">Rounfollio</div>\r\n    </div></a><a href="/projects/piatto.psd" class="project__a col-xs-12 col-sm-4">\r\n    <div class="row">\r\n      <div class="project__img-gutter">\r\n        <div class="zoom"><i class="fa fa-folder-open"></i></div><img src="/images/56f90910de1d2.jpg" alt="Piatto Psd" class="project__img">\r\n      </div>\r\n      <div class="project__title">Piatto Psd </div>\r\n    </div></a></div>', 'Projects_Images', 'full_html'),
(7, '<div class="page__wrapper_left">\r\n  <div class="projects">\r\n    <div class="projects__more col-xs-12">\r\n      <div class="projects__date">\r\n        <div class="projects__month">April</div>\r\n        <div class="projects__year">2016</div>\r\n      </div>\r\n      <div class="projects__about">\r\n        <div class="projects__title">This One</div>\r\n        <div class="projects__subtitle">Portfollio Cases. No Database Laravel Solution.</div>\r\n      </div>\r\n      <div class="projects__actions"><a href="/projects/this-one" class="projects__btn btn-sm btn-ghost btn-primary"><i class="fa fa-info-circle"></i>More info    </a></div>\r\n    </div>\r\n    <div class="projects__more project-modal col-xs-12">\r\n      <div class="projects__date">\r\n        <div class="projects__month">March</div>\r\n        <div class="projects__year">2016</div>\r\n      </div>\r\n      <div class="projects__about">\r\n        <div class="projects__title">Scanlibs Idea</div>\r\n        <div class="projects__subtitle">Parse scanlibs.com and interactive interpritation it in Slim + MySql + jQuery.</div>\r\n      </div>\r\n      <div class="projects__actions"><a href="/projects/scanlibs-idea" class="projects__btn btn-sm btn-ghost btn-primary"><i class="fa fa-info-circle"></i>More info</a></div>\r\n    </div>\r\n    <div class="projects__more project-modal col-xs-12">\r\n      <div class="projects__date">\r\n        <div class="projects__month">February</div>\r\n        <div class="projects__year">2016</div>\r\n      </div>\r\n      <div class="projects__about">\r\n        <div class="projects__title">Slim Scalling</div>\r\n        <div class="projects__subtitle">Website Blog, Users Profile, Admin Panel on Slim Framework.</div>\r\n      </div>\r\n      <div class="projects__actions"><a href="/projects/slim-scalling" class="projects__btn btn-sm btn-ghost btn-primary"><i class="fa fa-info-circle"></i>More info</a></div>\r\n    </div>\r\n    <div class="projects__more project-modal col-xs-12">\r\n      <div class="projects__date">\r\n        <div class="projects__month">January</div>\r\n        <div class="projects__year">2016</div>\r\n      </div>\r\n      <div class="projects__about">\r\n        <div class="projects__title">Contact Us</div>\r\n        <div class="projects__subtitle">Contact Form on Slim Framework + PSD to HTML.</div>\r\n      </div>\r\n      <div class="projects__actions"><a href="/projects/contact-us" class="projects__btn btn-sm btn-ghost btn-primary"><i class="fa fa-info-circle"></i>More info</a></div>\r\n    </div>\r\n    <div class="projects__more project-modal col-xs-12">\r\n      <div class="projects__date">\r\n        <div class="projects__month">December</div>\r\n        <div class="projects__year">2015</div>\r\n      </div>\r\n      <div class="projects__about">\r\n        <div class="projects__title">Roundfollio</div>\r\n        <div class="projects__subtitle">HTML Theme to Drupal integration.</div>\r\n      </div>\r\n      <div class="projects__actions"><a href="/projects/roundfollio" class="projects__btn btn-sm btn-ghost btn-primary"><i class="fa fa-info-circle"></i>More info</a></div>\r\n    </div>\r\n    <div class="projects__more project-modal col-xs-12">\r\n      <div class="projects__date">\r\n        <div class="projects__month">November</div>\r\n        <div class="projects__year">2015</div>\r\n      </div>\r\n      <div class="projects__about">\r\n        <div class="projects__title">Piatto PSD</div>\r\n        <div class="projects__subtitle">PSD to HTML coding.</div>\r\n      </div>\r\n      <div class="projects__actions"><a href="/projects/piatto.psd" class="projects__btn btn-sm btn-ghost btn-primary"><i class="fa fa-info-circle"></i>More info</a></div>\r\n    </div>\r\n  </div>\r\n</div>', 'Cases_Table', 'full_html');
