INSERT INTO `field_revision_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 1, 1, 'und', 0, 'Hello! My name is Sergey Buharow. I have experience building dynamic and responsive websites using HTML, PHP, MySQL, CSS, jQuery, and AJAX. My areas of expertise are in building web apps using PHP, MySQL, Slim 2.x, Laravel 5.x, Drupal 7.x and Bootstrap 3.\r\n\r\nI like writing clean and easy to maintain code. I really like help on others projects when necessary. I appreciate communication with the client and I''m doing to be as responsive as possible and report systematically on project progress.\r\n\r\nRequire a developer for one of your projects? I''d ready to discuss it!', '', 'filtered_html'),
('node', 'article', 0, 2, 2, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>HTML5, CSS3, jQuery, Bootstap, Animate.css, Photoshop</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">BEM, Cross browser testing, Validation, Animation, SEO-friendly, CSS optimization, Image mininify etc.<br/></p>\r\n      <p class="this-one__p"><a href="https://github.com/kt815/piatto-psd-to-html-animated" class="this-one__a">https://github.com/kt815/piatto-psd-to-html-animated</a><br/></p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-51-31.jpg" alt="Landing PSD &quot;Piatto&quot; to HTML coding." class="this-one__img"/>\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-51-40.jpg" alt="Landing PSD &quot;Piatto&quot; to HTML coding." class="this-one__img"/></p>\r\n    </div>', '', 'full_html'),
('node', 'article', 0, 8, 3, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>PHP, Drupal 7 CMS, Views, jQuery.</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">Drupal Theme "Roundfollio" integration.<br></p>\r\n      <p class="this-one__p">        <a href="https://github.com/kt815/drupal-rounfolio-free-bassoon" class="this-one__a">https://github.com/kt815/drupal-rounfolio-free-bassoon</a><br>          </p>      <p class="this-one__p"><a href="http://kt815.esy.es/roundfolio" class="this-one__a">http://kt815.esy.es/roundfolio</a><br></p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-38-38.jpg" alt="Drupal Theme &quot;Roundfollio&quot; integration." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-38-03.jpg" alt="Drupal Theme &quot;Roundfollio&quot; integration." class="this-one__img"></p>\r\n    </div>', '', 'full_html'),
('node', 'article', 0, 9, 4, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>PHP, Slim Framework, jQuery Ajax, Photoshop.</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">Mobile First, Admin Panel, jQuery AJAX, ORM Database, CSRF Protection, Grid (12 column), Jade, Less, Npm, Bower, Grunt.<br></p>\r\n      <p class="this-one__p">        <a href="https://github.com/kt815/slim-contacts-rotary" class="this-one__a">https://github.com/kt815/slim-contacts-rotary</a><br>        <a href="https://github.com/kt815/contacts-psd-to-html-media-min" class="this-one__a">https://github.com/kt815/contacts-psd-to-html-media-min</a><br>          </p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-52-52.jpg" alt="Slim Framework Contacts Form jQuery + PSD to HTML." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-53-43.jpg" alt="Slim Framework Contacts Form jQuery + PSD to HTML." class="this-one__img"></p>\r\n    </div>', '', 'full_html'),
('node', 'article', 0, 10, 5, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>PHP, Slim Framework, jQuery Ajax, Markdown, Monolog.</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">Blog Example, User Account, Admin Panel, Routing Engine, Views and Templates, ORM Database, Image processor, REST etc.<br></p>\r\n      <p class="this-one__p">        <a href="https://github.com/kt815/slim-scaling-couscous" class="this-one__a">https://github.com/kt815/slim-scaling-couscous</a><br></p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-54-21.jpg" alt="Slim Framework Blog Example." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-54-56.jpg" alt="Slim Framework Blog Example." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-55-03.jpg" alt="Slim Framework Blog Example." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-55-46.jpg" alt="Slim Framework Blog Example." class="this-one__img">\r\n</p>\r\n    </div>', '', 'full_html'),
('node', 'article', 0, 11, 6, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>PHP, Laravel 5, jQuery Ajax, MySQL.</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">Parse external website, MySQL ManyToMany implementation, Useful jQuery Interface.<br></p>\r\n      <p class="this-one__p"><a href="https://github.com/kt815/scanlibs-clone-categories-relations" class="this-one__a">https://github.com/kt815/scanlibs-clone-categories-relations</a><br></p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-47-40.jpg" alt="Laravel 5 Parser external website and Useful Interface." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-17_8-48-10.jpg" alt="Laravel 5 Parser external website and Useful Interface." class="this-one__img">\r\n</p>\r\n    </div>', '', 'full_html'),
('node', 'article', 0, 12, 7, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>PHP, Laravel Jade, Gulp, Less + Drupal.</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">No Database Laravel Solution + Drupal Imlementation.<br></p>\r\n      <p class="this-one__p"><a href="https://github.com/kt815/cases-stanning-night" class="this-one__a">https://github.com/kt815/cases-stanning-night</a><br></p>          \r\n      <p class="this-one__p"><a href="https://github.com/kt815/cases-drupal-system" class="this-one__a">https://github.com/kt815/cases-drupal-system</a><br></p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-04-18_8-36-41.jpg" alt="Portfollio Cases." class="this-one__img">\r\n</p>\r\n    </div>', '', 'full_html'),
('node', 'article', 0, 13, 8, 'und', 0, '    <p class="this-one__technologies"><strong class="this-one__strong">Used technologies: </strong>PHP, MySQL ORM, Laravel, Jade, Gulp, Less, Paypal Payment, Stripe API, Bootstrap, jQuery.</p>\r\n    <div class="this-one__description">\r\n      <p class="this-one__p">Laravel 5.2 Shop Cart Solution. Additional has two branches: paypal and stripe payments.<br></p>\r\n      <p class="this-one__p"><a href="https://github.com/kt815/tinyshop-laravel-implementation" class="this-one__a">https://github.com/kt815/tinyshop-laravel-implementation</a><br></p>          \r\n      <p class="this-one__p">\r\n<img src="http://kt815.esy.es/images/projects/2016-05-15_21-19-19.png" alt="Portfollio Cases." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-05-15_21-19-26.png" alt="Portfollio Cases." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-05-15_21-19-57.png" alt="Portfollio Cases." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-05-15_21-20-08.png" alt="Portfollio Cases." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-05-15_21-20-17.png" alt="Portfollio Cases." class="this-one__img">\r\n<img src="http://kt815.esy.es/images/projects/2016-05-15_21-20-26.png" alt="Portfollio Cases." class="this-one__img">\r\n</p>\r\n    </div>', '', 'full_html');
